import "./header.scss";
import * as Icons from "../icons/index";
import Logo from "./Logo";

function Header() {
  return (
    <header>
      <div className="container">
        <div className="container-inner">
          <div className="header-left">
            <div className="logo">
              <Logo />
            </div>
            <nav>
                <ul>
                    <li>ANASAYFA</li>
                    <li>DERSLER</li>
                    <li>HAKKIMIZDA</li>
                    <li>İLETİŞİM</li>
                    <li></li>
                </ul>
            </nav>
          </div>
          <div className="header-right"></div>
        </div>
      </div>
    </header>
  );
}

export default Header;
